// [{"id":16352,"name":"Starlight Archeum Shard","icon":"icon_item_0365","type":"Archeum","grade":1,"description":"Pure, condensed magic, trapped in physical form. Energy from the stars makes it especially useful in handicrafting.\r\n\r\nA lack of magic--or life force--creates monsters, changes the climate, and weakens the barriers that protect the world from other dimensions. Using Archeum releases healing magic back into nature.","useEffect":"Alchemy: Spend 10 Labor to combine 5 Starlight Archeum Shards into 1 Starlight Archeum Crystal. Auto-use: shift+right-click","price":250,"bindsOnPickup":false,"sealed":false,"salvageable":false},{"id":23633,"name":"Gilda Star","icon":"icon_item_0476","type":"Coin","grade":1,"description":"An ancient coin made of pure gold and minted in Auroria centuries ago. They are the rarest and most valuable coins still in circulation, and can purchase the most important quality goods, such as the |cORANGE|houses|c| and |cORANGE|workbench designs|c| sold on |cORANGE|Mirage Isle|c|.\r\n\r\nCan be obtained from |cBLUE|Daily Contracts|c|, other quests, and special events.","price":0,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":26703,"name":"Magic Injection Verification","icon":"quest/icon_item_quest002","type":"Quest Item","grade":1,"description":"This certifies that the magic has been successfully injected.","price":0,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":28188,"name":"Abyssal Crystal","icon":"icon_item_1235","type":"Material","grade":3,"description":"It burns your hand with demonic, abyssal magic. It can be obtained in |cBLUE|dungeons|c|.\r\nUsed for equipment crafting.","price":360,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":28189,"name":"Abyssal Shard","icon":"icon_item_1236","type":"Material","grade":2,"description":"It warms your hand with demonic, abyssal magic. It can be obtained in |cBLUE|dungeons|c|.\r\nUsed for equipment crafting.","price":1800,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":28868,"name":"Crystallized Tears of the Dead","icon":"quest/icon_item_quest147","type":"Quest Item","grade":1,"description":"Freida has condensed the Tears of the Dead into these crystals for use in Estrella's spell. You will need three such crystals to finish the Morpheus Doll.","price":0,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":28874,"name":"Morpheus's Hair","icon":"icon_item_0033","type":"Quest Item","grade":1,"description":"This lock of hair came from the head of Morpheus the pirate. Estrella needs it to complete her enchanted doll.","price":10000,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":28986,"name":"Timespace Scroll","icon":"icon_item_0004","type":"Other","grade":1,"description":"The ancient spells on this scroll were once used to bind a powerful evil beneath the Esya Dena Volcano. If you can find the altar in Heedmar where the ritual was carried out, you could reverse the process... But releasing such a creature could have dire consequences.","price":10,"bindsOnPickup":false,"sealed":false,"salvageable":false},{"id":29499,"name":"Alexander's Staff","icon":"icon_item_staff_2h_0032","type":"Quest Item","grade":1,"description":"Alexander was for decades regarded as the greatest mage the Delphinad Library in Auroria had ever produced. He bequeathed this staff to his student, Arde.","price":10000,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":29511,"name":"Kraken Eye","icon":"icon_item_0184","type":"Quest Item","grade":1,"description":"An eye from one of the monstrous Kraken that wander the Arcadian Sea.","price":10000,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":29512,"name":"Hanure's Heart","icon":"quest/icon_item_quest198","type":"Quest Item","grade":1,"description":"The fist-sized organ continues to beat, pumping out thin jets of warm blood.","price":10000,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":29513,"name":"Anthalon's Staff","icon":"icon_item_staff_2h_0003","type":"Quest Item","grade":1,"description":"This staff was once used by the dreaded necromancer Anthalon, leader of the Crimson Army in Kyrios's absence.","price":10000,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":29514,"name":"Hound of Kyrios Soulstone","icon":"quest/icon_item_quest021","type":"Quest Item","grade":1,"description":"The soul sealed inside the stone once belonged to a Hound of Kyrios, a type of powerful soldier that worships the god of destruction.","price":10000,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":29515,"name":"Vyrava's Manastone","icon":"quest/icon_item_quest073","type":"Quest Item","grade":1,"description":"Extracted from Vyrava's chest, this stone contains mana that has been lit aflame. It will burn forever and can cause conflagrations on contact.","price":10000,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":30002,"name":"Meina's Ring","icon":"icon_item_ring_0004","type":"Quest Item","grade":1,"description":"You can faintly make out the words \"For Eternity\" engraved on this tarnished ring.","price":10000,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":30003,"name":"Glenn's Ring","icon":"icon_item_ring_0004","type":"Quest Item","grade":1,"description":"You can faintly make out the words \"Together Always\" engraved on this tarnished ring.","price":10000,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":30004,"name":"Jola's Scaly Frill","icon":"icon_item_0053","type":"Quest Item","grade":1,"description":"It seems to radiate its own, dim light... as well as a faint, serpentine hiss.","price":10000,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":30765,"name":"Lucid Mirage Fishing Rod","icon":"icon_item_1071","type":"Fishing Rod","grade":1,"description":"Can be used in the Fishing Contest on Mirage Isle for 1 hour.\r\n\r\n\r\n|cLIGHT_BLUE|Contest Time: 12PM-12AM every Saturday|c|","price":0,"bindsOnPickup":true,"sealed":false,"salvageable":false,"remainingTime":"1h 0m","equip":{"minDamage":0,"maxDamage":0,"magicAttack":0,"healingPower":0,"equipEffect":"Enables fishing skills in the Mirage Fishing Contest.","petLevel":0,"stats":[]}},{"id":31972,"name":"Ayanad Wizard's Token","icon":"icon_item_1739","type":"Quest Item","grade":2,"description":"This spellbound token belonged to an Ayanad wizard who inscribed it with runes from his name. Its owner is long dead, but it still retains his magic. It may serve as a useful artifact for anyone venturing into the library ruins.","price":0,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":32103,"name":"Onyx Archeum Essence","icon":"icon_item_4457","type":"Archeum","grade":1,"description":"Imbued with mysterious garden lights, as a core source of magic, it is used in crafting consumables and machines.\r\n\r\nCan be acquired by delivering Cargo to |cLIGHT_BLUE|Cargo Exchangers|c|, or Delphinad Ghost Ship Stone Slabs to the |cLIGHT_BLUE|Shadow Merchant|c| on Freedich Island.","price":9500,"bindsOnPickup":false,"sealed":false,"salvageable":false},{"id":35898,"name":"Shatigon's Sand","icon":"icon_item_2045","type":"Talisman","grade":1,"description":"Sand extracted from Shatigon's Sandglass.\r\n\r\nTurns back time and restores broken machines in the Hereafter (ships, vehicles, and equipment).\r\n\r\nTakes 5 minutes to repair ships and vehicles, and immediately repairs equipment.","useEffect":"Right-click a destroyed machine to restore it.","price":100,"bindsOnPickup":false,"sealed":false,"salvageable":false},{"id":37509,"name":"Kyrios Badge","icon":"icon_item_4050","type":"Coin","grade":1,"description":"Granted to those who have proven their strength.\r\n\r\nCan be obtained from any |cORANGE|arena|c|, based on results. Can be traded for other items in the Arena Shop.","price":0,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":38093,"name":"Revenant Soulstone","icon":"icon_item_2516","type":"Other","grade":1,"description":"A soulstone that contains the residual energy of a vanquished revenant.\r\n\r\nAcquire from defeating Aust Followers; can be used to create weapons and armor at the |cBLUE|Soulforged Anvil|c| in |cLIGHT_BLUE|Diamond Shores|c|.","price":50,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":39780,"name":"Sunset Portalstone","icon":"icon_item_2871","type":"Material","grade":5,"description":"A rare, sunset-colored stone occasionally discovered in dungeons. Its unique properties can create or strengthen various gear.\r\nObtained in |cLIGHT_BLUE|Mistsong Summit.|c|","price":1485,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":39803,"name":"Mistsong Grinding Guardian Scroll","icon":"icon_item_2299","type":"Other","grade":3,"description":"Grants continued dungeon access after you pass your daily entrance limit.\r\n\r\n|cBLUE|Caution:|c|\r\nEntering the same dungeon after the daily entrance limit was met will consume this scroll.\r\nOnly for dungeons with a level limit of |cORANGE|55 or higher|c|.\r\n\r\n|cLIGHT_BLUE|Valid Dungeons|c|\r\nMistsong Summit\r\nAbyssal Library\r\nNoryette Challenge","price":10000,"bindsOnPickup":false,"sealed":false,"salvageable":false},{"id":40229,"name":"Territory Pence","icon":"icon_item_3240","type":"Other","grade":1,"description":"This coin proves your invaluable contributions to the territory. Every 100 Territory Pence you earn can be exchanged for a Territory Coin.","useEffect":"Use 100 Territory Pence to craft a Territory Coin.\r\nAuto-use: shift+right-click","price":0,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":41488,"name":"Blue Salt Bond","icon":"icon_item_3493","type":"Quest Item","grade":2,"description":"A token issued by the Blue Salt Brotherhood. Can be used to help rank up your Community Center, or to support your faction activities.\r\n\r\n|cORANGE|Community Center Support Information|c|\r\nRequired Level: |cBLUE|Lv30+|c|\r\nResidency: |cBLUE|Nuia or Haranya|c|\r\nWorkbench: |cBLUE|Community Center Workbench|c|","price":0,"bindsOnPickup":true,"sealed":false,"salvageable":false},{"id":42337,"name":"Ahnimar Water Pack","icon":"icon_item_0439","type":"Contraption","grade":1,"description":"The water in this pack is stored under high pressure so it can be sprayed instead of poured.","useEffect":"Discard the Ahnimar water yoke.","price":0,"bindsOnPickup":true,"sealed":false,"salvageable":false,"equip":{"minDamage":0,"maxDamage":0,"magicAttack":0,"healingPower":0,"equipEffect":"Ride Bubble","petLevel":0,"stats":[]}},{"id":43128,"name":"Cursed Armor Scrap","icon":"icon_item_3864","type":"Material","grade":1,"description":"Can be obtained in |cBLUE|Whalesong Harbor|c|.\r\nUsed to make |cORANGE|Cursed Armor|c|, which is required to craft an Ipnysh Blessing.","useEffect":"Spend 500 Labor to combine 50 Cursed Armor Scraps into a Complete Cursed Armor.\r\nAuto-use: shift + right-click","price":100,"bindsOnPickup":false,"sealed":false,"salvageable":false},{"id":43129,"name":"Acid Gobbet","icon":"icon_item_3887","type":"Material","grade":1,"description":"Can be obtained on |cBLUE|Aegis Island|c|. Used to make |cORANGE|Acid Pouches|c|, which are required to craft an Ipnysh Blessing.","useEffect":"Spend 500 Labor to combine 50 Acid Bubbles into an Acid Poison Pouch.\r\nAuto-use: shift + right-click","price":100,"bindsOnPickup":false,"sealed":false,"salvageable":false},{"id":44917,"name":"Smoldering Box","icon":"icon_item_4261","type":"Unidentified","grade":4,"description":"A reward for contributing towards the growing dragon. Contains three Honorforged Medals, with a small chance of receiving a Red Dragon Spinal Ridge instead.","useEffect":"Check the box.","price":1250,"bindsOnPickup":true,"overlay":"unidentified","sealed":false,"salvageable":false},{"id":45184,"name":"Abyssal Soot","icon":"quest/icon_item_quest007","type":"Quest Item","grade":1,"description":"Strange, crystallized mana leaks continuously out of Serpentis, but it always looks charred and